export const generatePaymentReceipt = async (paymentData) => {
  const cartItems = paymentData.raw?.cartItems || [];
  const pdf = new jsPDF('p', 'mm', 'a4');
  
  for (let i = 0; i < cartItems.length; i++) {
    const cartItem = cartItems[i];
    
    if (i > 0) {
      pdf.addPage();
    }
    
    // Create temporary div for HTML content
    const tempDiv = document.createElement('div');
    tempDiv.innerHTML = createReceiptHTML(cartItem, paymentData);
    tempDiv.style.position = 'absolute';
    tempDiv.style.left = '-9999px';
    tempDiv.style.top = '0';
    document.body.appendChild(tempDiv);
    
    try {
      // Convert HTML to canvas
      const canvas = await html2canvas(tempDiv.firstElementChild, {
        scale: 2,
        useCORS: true,
        allowTaint: true,
        backgroundColor: '#ffffff'
      });
      
      // Add canvas to PDF
      const imgData = canvas.toDataURL('image/png');
      const imgWidth = 210; // A4 width in mm
      const imgHeight = (canvas.height * imgWidth) / canvas.width;
      
      pdf.addImage(imgData, 'PNG', 0, 0, imgWidth, imgHeight);
      
    } catch (error) {
      console.error('Error generating canvas:', error);
    } finally {
      // Clean up
      document.body.removeChild(tempDiv);
    }
  }
  
  return pdf;
};

export const downloadPaymentReceipt = async (orderId, orderData = null) => {
  try {
    let paymentData = orderData;
    
    if (!paymentData) {
      const { getPaymentByOrderId } = await import('../actions/product');
      paymentData = await getPaymentByOrderId(orderId);
    }
    
    if (!paymentData || !paymentData.raw?.cartItems) {
      throw new Error('Payment data not found or invalid');
    }
    
    const pdf = await generatePaymentReceipt(paymentData);
    pdf.save(`payment-receipt-${paymentData.id}.pdf`);
    
    return true;
  } catch (error) {
    console.error('Error generating receipt:', error);
    throw error;
  }
}; 